// SPDX-License-Identifier: MIT
pragma solidity 0.8.7;

contract Animal{
    event Talk(string name,string sound);
    string name;
    uint legs;
    uint eyes;
    constructor (string memory n, uint l,uint e){
        legs=l;
        eyes=e;
        name = n;
    }

    function talk() external virtual{
    }
}


contract Dog is Animal{
    string breed;

    constructor (string memory  n,string memory b) Animal(n,4,2){
        breed=b;
    }


    function talk() external override{
        emit Talk(name,"Bark");
    }

}

